import Head from "next/head";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <>
    <Head>
      <link rel="stylesheet" href="/static/main.css" />
    </Head>
    <Header />
    {props.children}
    <Footer />
    <style jsx>{`
      height: 100vh;
    `}</style>
  </>
);

export default Layout;
